import React from "react"
import Box from '@material-ui/core/Box'
import Typography from '@material-ui/core/Typography'
import Button from '@material-ui/core/Button'

const NavBar = () => {
  return (
    <Box p={2} style={{height:"60px", position:"relative", zIndex:1000, boxShadow: '0 0 14px rgba(0,0,0,0.25), 0 0 6px rgba(0,0,0,0.22)'}}>
        <Typography style={{fontSize:"20px",color: "#444", fontWeight:"800"}}>Charlotte Therapists</Typography>
        <Button>I'm a Charlotte Therapist</Button>
    </Box>
  )
}

export default NavBar
